DROP TABLE IF EXISTS `shadespotter`;
CREATE TABLE `shadespotter` (
  `id` int(50) unsigned NOT NULL AUTO_INCREMENT,
  `brand` varchar(150) NOT NULL COMMENT '品牌名称',
  `type` varchar(50) DEFAULT NULL COMMENT '产品类型',
  `series` varchar(150) DEFAULT NULL COMMENT '产品系列',
  `series_url` varchar(500) DEFAULT NULL COMMENT '产品系列url',
  `name` varchar(100) DEFAULT NULL COMMENT '产品名称',
  `color` varchar(20) DEFAULT NULL COMMENT '颜色',
  `create_time` bigint(50) DEFAULT NULL COMMENT '更新时间',
  `del_status` tinyint(4) DEFAULT '0' COMMENT '是否删除 -1：已删除   0：正常',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='彩妆色彩数据库';

